import React from 'react';
import './Header.css';

function Header() {
  return (
    <div className="header">
      <div className="logo">Logo</div>
      <div className="nav">
        <span>课程管理</span>
        <span>学习资源</span>
      </div>
      <div className="user-options">
        <span>通知</span>
        <span>账户</span>
        <span>设置</span>
      </div>
    </div>
  );
}

export default Header;
